import './App.css';
import AppBar from "@mui/material/AppBar";
import Toolbar from '@mui/material/Toolbar';
import Typography from "@mui/material/Typography";
import Carlist from './components/Carlist';

function App() {
  return (
    <div className="App">
      <AppBar position='static'>
        <Toolbar>
          <Typography variant='h6'><img src="/home/mnck/carshop.jpeg" alt='' width={100} height={55}/>Car-shop</Typography>
        </Toolbar>    
      </AppBar>
      <Carlist/>
      <img src="/home/mnck/carshop.jpeg" alt='' width={100} height={55}/>
    </div>
  );
}
export default App;
